import { useSelector, useDispatch } from 'react-redux';
import { useState } from 'react';

export const ShowAccounts = () => {

    const users = useSelector(state => state.accountList);
    const loginuser = useSelector(state => state.user);

    return (
        <div>
            <h1>Wecome {loginuser.username}</h1>

            <h1>List Of Account</h1>
            <table>
                <tbody>
                {users.map(x=> (
                    <tr key={x.username}>
                        <td>{x.password}</td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};
